import "./Main.css"

const MainPage = ({ screenHandler }) => {
    return (
        <div className="Main">
            <div className='main-image'></div>
            <a className='skull' onClick={screenHandler("chat")}></a>
            <a className='book'></a>
        </div>
    )
}
export default MainPage;
